def solve(n, m):
	def intersections(a, b):
		return [(a[0] + b[0], a[1] + b[1]) for a in [x for x in range(n) if x!= a]]
	def add_point(a, b, c):
		x = a + b
		y = b + c
		if x < n and y < m:
			return
		if x > n:
			x = x - n
		if y > m:
			y = y - m
		if x == y:
			return
		return intersections(x, y)
	l = []
	for i in range(4):
		l.append(add_point(i, i, i))
	l.sort()
	print(*l[-2::-1], sep="\n")
	return

n, m = list(map(int, input().split()))
print("%d %d\n" % (n, m))
solve(n, m)
